  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai NWR outlines
  Refuge accomplishments from January through April of 1954. The report begins by
  summarizing the weather conditions during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, and predators- is also covered.
  The Refuge development and maintenance section discusses physical developments.
  Resource management is outlined; topics include fur harvesting and timber removal.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, and violations. Items of interest and photographs are attached.\",\n\t\"license_title\":
